  false,\n\t\"url\": null,\n\t\"notes\": \"Tern populations were reduced in the last
  quarter of the nineteenth century, when gunners found a market for the wings and
  whole skins of gulls and terns in the millinery trade. The increase in gull numbers
  triggered a second important decline in tern numbers starting in the-1940s. This
  management plan provides an outline of the tasks proposed to restore tern numbers
  to levels approximating those reached during the last period of population growth.
  It outlines specific objectives in this effort.\",\n\t\"license_title\": \"License
